import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Skills() {
    return (
        <Container>
      <Row>
        <Col xs> <FontAwesomeIcon icon="fa-brands fa-js fa-5x" size="5x" fa-fw /> </Col>
        <Col xs={{ order: 12 }}>  <FontAwesomeIcon icon="fa-brands fa-css3-alt" size="5x" fa-fw /></Col>
        <Col xs={{ order: 1 }}>           <FontAwesomeIcon icon="fa-brands fa-node" size="5x" fa-fw /></Col>
      </Row>
    </Container>
)
}
export default Skills
